INSERT INTO `postagens` VALUES (24,'Classificação dos Ângulos','<p>Um ângulo pode ser classificado de acordo com a sua medida. Além de nulo (ângulo de 0º), um ângulo pode ser agudo, reto, obtuso, raso, côncavo ou inteiro.</p><p><br></p><p>Ângulo agudo: quando sua medida é um número maior que 0 e menor que 90º.</p><p><br></p><p><img src=\"data:image/png;base64,\" alt=\"\"></p><p>Note que o ângulo AÔB, representado também por α, é um ângulo maior que 0º e menor que 90º.</p><p><br></p><p>Ângulo reto: possui exatamente 90º. Quando isso acontece, podemos dizer também que as semirretas se cruzam de forma perpendicular.</p><p><br></p><p><img src=\"data:image/png;base64,\" alt=\"\"></p><p>Geralmente o ângulo reto possui a região angular (região em laranja na imagem) representada por um quadrado.</p><p><br></p><p>Ângulo obtuso: quando sua medida é maior que 90º e menor que 180º.</p><p><br></p><p><img src=\"data:image/png;base64,\" alt=\"\"></p><p>Ângulo raso: conhecido também como meia-volta ou meia-lua, esse ângulo equivale à metade de um ângulo inteiro, logo possui exatamente 180º.</p><p><br></p><p><br></p><p>Ângulo raso</p><p>&nbsp;</p><p><img src=\"data:image/png;base64,\" alt=\"\"></p><p><br></p><p>Ângulo côncavo: menos comum nas situações cotidianas que os demais, é o ângulo que tem medida maior que 180º e menor que 360º.</p><p><br></p><p>&nbsp;</p><p><br></p><p><img src=\"data:image/png;base64,\" alt=\"\"></p><p>Ângulo inteiro: como o nome sugere, esse ângulo representa a volta completa, possuindo exatamente 360º.\"</p><p><img src=\"data:image/png;base64,\" alt=\"\"></p>',1,'default.png','2022-07-24 22:16:39',1,NULL),(25,'Triângulos ','<h3>Propriedades de um triângulo</h3><p><span style=\"font-size: 1rem;\"><strong>As propriedades a seguir são válidas para todo triângulo.</strong></span><br><p><br></p><ul><li>A soma dos ângulos internos é sempre igual a 180°.</li><li>A soma dos ângulos externos é sempre igual a 360°.</li><li>O menor lado é sempre oposto ao menor ângulo interno do triângulo.</li><li>O maior lado é sempre oposto ao maior ângulo interno do triângulo.</li></ul></p>',2,'default.png','2022-07-24 22:17:39',1,24);
